import Button from './Button';

const TextInput = (props) => {
    const { type, value, text, placeholder } = props;
    return (
        <div>
            <div>
                <label htmlFor={ type }>{ text }</label>
                <input type='text' placeholder='Your height in cms' required id='height' />
            </div>
            <div>
                <Button />
            </div>
        </div>
    );
}

export default TextInput;
